난 자기 또래 귀신 나와서 같이 놀았으면 좋겠다 이렇게 생각했는데 그런 생각이 어떻게 들지;
이전 화 어디에서도 동근이가 그런 생각을 한 적도 없는거 같은데

사장 멋있네.. 자기도 위험한디..
직원 걱정 하고 있네 ;
저런 사장님 밑에서는 노가다도 괜찮겠다

아니 우리민족 원래 단결의민족 아니였음??

첫 배댓 좋아요 짝수길래 눌렀더니만 어떤 갔나샠히가 
짝수를만들어놔....;;

)상준
아 진짜 맞춤법 틀린거 쉴드 치는 새-낀 이해 안되네
멍청한건 니 머리지, 논리는 ㅈ도 없으면서 깔려고만 하네

아마 저 귀신들은 독립운동도 하고 있었다는걸

모르고 있었을거 같음.... 그걸 알기전에

다들 돌아가셨을테니..;

늘 교권이 바닥이라 짖어대는 종자들은 대체 나이가 몇인거지?
여전히 선생한테 말한마디 제대로 못하는 학생들이 99%인데 뉴스에 나오는 일부 중의 일부만 보는 탈급식들이 뭘 안다고 지껄여대는거야 ㄹㅇ
"선생이랑 싸우고 때리고" 애초에 이런 내용이 뉴스에 왜 나오겠냐?
흔치않은 일이니까 뉴스에 나오지; 장례식장에서 사람 하나 죽었다고 뉴스에 실리나? 유명인이나 큰 사고로 즉, 흔치않은 죽음일때만 실어주잖아; 
저 머리에 쓰레기만 가득한 멍청이들은 뉴스가 세상의 모든것인것마냥 짖어대는게 이상하단 생각을 못하나? 겪어보고 짖어대 제발;
학생 때문에 고통받는 교사보다 교사 때문에 고통받는 학생들이 여전히 훨씬 많아; 학생 타이틀 떨어졌으면 입 닫고 현직이 하는 말에 귀나 귀울려 니 하찮은 시야랑 지식에 의존해 아가리 털어대지말고

와 진짜 존나 무서웠겠다;;;;;
계단으로 뛰어서 엘베 따라잡고 몇층될때마다 얼굴보이고 도착하면
존나 섬뜩할텐데 진짜 존나무섭겠다.....

진짜 선동질 당해서 아무것도 모르는 상태로 욕하는 사람들 너무 싫다;; 
지난번에 고등학교 선생님 자살 사건도 아무것도 모르는 네티즌들이  여고생 성추행이랍시고 온갖 욕 다 해서 그렇게 된거 아니냐? 
진짜 방구석에서 손꾸락 밖에 놀릴 줄 아는 애들 없어졌으면
